import './App.css';
import { reduxForm, Field } from 'redux-form';

function App(props){
  const {handleSubmit}=props;
    return (
      <div className="App">
        <form onSubmit={handleSubmit((formValues)=>alert("Submited Data: "+formValues['first']+" "+formValues['second']))}>
          <label>First Name</label>
          <Field type="text" name="first" component="input"></Field><br/>
          <label>Second Name</label>
          <Field type="text" name="second" component="input"></Field>
          <button type="submit">SubmitMe</button>
        </form>
      </div>
    );
}
App = reduxForm({
  // a unique name for the form
  form: 'myForm'
})(App)
export default App;
